import React from "react";

import Page from "../../components/Page";
import IntroduceText from "../../components/IntroduceText";

import { GoogleMap, LoadScript, Marker } from "@react-google-maps/api";

import { Grid, CircularProgress, Typography } from "@mui/material";
import CustomBox from "../../components/CustomBox";

const googleMapsApiKey = "AIzaSyBRsdmnSRwU4va6sYZEs7pyi2MZ9XhgvPw";

function Index() {
  const mapOptions = {
    fullscreenControl: false,
    panControl: false,
    zoomControl: false,
    mapTypeControl: false,
    streetViewControl: false,
    minZoom: 11,
    maxZoom: 20,
  };

  const center = {
    lat: 4507088.9938378,
    lng: 14141177.9109503,
  };

  return (
    <Page title="CONTACTS">
      <Grid
        container
        spacing={2}
        justifyContent="center"
        alignItems="center"
        mt={3}
      >
        <Grid item xs={12} lg={6}>
          <IntroduceText firstLine="Contact" secondLine="Information" />
          <CustomBox sx={{ textAlign: "left" }}>
            <Typography>반토 주식회사</Typography>
            <Typography>서울특별시 서초구 서초동 1362 B-109호</Typography>
          </CustomBox>
          <CustomBox sx={{ textAlign: "left" }}>
            <Typography>070.7010.7200</Typography>
          </CustomBox>
          <CustomBox sx={{ textAlign: "left" }}>
            <Typography>jaylee@banto.io</Typography>
          </CustomBox>
          <CustomBox
            component="button"
            sx={{
              color: "white",
              width: "222px",
              height: "71px",
              background: "#333333",
              borderRadius: 0,
            }}
          >
            CONTACT US
          </CustomBox>
        </Grid>
        <Grid item xs={12} lg={6}>
          <LoadScript
            googleMapsApiKey={googleMapsApiKey}
            loadingElement={
              <Grid
                container
                justifyContent="center"
                alignItems="center"
                sx={{ height: "100%", width: "100%", backgroundColor: "black" }}
              >
                <CircularProgress color="success" />
              </Grid>
            }
          >
            <GoogleMap
              mapContainerStyle={{ width: "100%", height: "100%" }}
              center={center}
              zoom={13}
              options={mapOptions}
            >
              <Marker
                key={1}
                icon="/images/icon/current_location.png"
                position={center}
              />
            </GoogleMap>
          </LoadScript>
        </Grid>
      </Grid>
    </Page>
  );
}

export default Index;
